import React, { useState } from 'react';
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, BarElement, CategoryScale, LinearScale } from 'chart.js';

ChartJS.register(BarElement, CategoryScale, LinearScale);

const sampleEvents = [
  { id: 1, difficulty: 'High' },
  { id: 2, difficulty: 'Low' },
  { id: 3, difficulty: 'Medium' },
  { id: 4, difficulty: 'High' },
  { id: 5, difficulty: 'Low' },
];

const FraudPage = () => {
  const [filter, setFilter] = useState('All');

  const filtered = filter === 'All'
    ? sampleEvents
    : sampleEvents.filter(e => e.difficulty === filter);
  console.log(filtered);
  const counts = {
    Low: sampleEvents.filter(e => e.difficulty === 'Low').length,
    Medium: sampleEvents.filter(e => e.difficulty === 'Medium').length,
    High: sampleEvents.filter(e => e.difficulty === 'High').length,
  };

  const chartData = {
    labels: ['Low', 'Medium', 'High'],
    datasets: [{
      label: 'Event Count',
      data: [counts.Low, counts.Medium, counts.High],
      backgroundColor: ['#34d399', '#fbbf24', '#f87171'],
    }],
  };

  return (
    <div>
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-2xl font-bold">Fraud Detection Events</h2>
        <select
          className="border px-2 py-1 rounded"
          value={filter}
          onChange={(e) => setFilter(e.target.value)}
        >
          <option value="All">All Difficulties</option>
          <option value="Low">Low</option>
          <option value="Medium">Medium</option>
          <option value="High">High</option>
        </select>
      </div>

      <Bar data={chartData} />

      <ul className="mt-6 space-y-2">
        {filtered.map(event => (
          <li key={event.id} className="p-4 border bg-white shadow-sm rounded">
            <strong>Event #{event.id}</strong> â€“ Difficulty: <span className="font-semibold">{event.difficulty}</span>
          </li>
        ))}
      </ul>
    </div>
  );
};
 // check if any object inside is malformed
export default FraudPage;
